package advent2018;

public class AoC2018Day5Part1 {
    public static void main(String[] args) {
        int result;

        result = test("aA");
        assert result == 0 : "unexpected result is " + result;
        System.out.println(result);

        result = test("abBA");
        assert result == 0 : "unexpected result is " + result;
        System.out.println(result);

        result = test("aabAAB");
        assert result == 6 : "unexpected result is " + result;
        System.out.println(result);

        result = test("dabAcCaCBAcCcaDA");
        assert result == 10 : "unexpected result is " + result;
        System.out.println(result);

        result = test("");
        assert result == 11636 : "unexpected result is " + result;
        System.out.println(result);
    }

    private static int test(String s) {
        String result = reactAll(s);
        return result.length();
    }

    private static String reactAll(String s) {
        boolean canReact = true;
        while (canReact) {
            String newS = react(s);
            canReact = newS.length() < s.length();
            s = newS;
        }
        return s;
    }

    private static String react(String s) {
        char[] chars = s.toCharArray();
        for (int i = 0; i < chars.length - 1; ++i) {
            if (canReact(chars[i], chars[i + 1])) {
                chars[i] = '0';
                chars[i + 1] = '0';
                break;
            }
        }
        return String.valueOf(chars).replace("0", "");
    }

    private static boolean canReact(char ch1, char ch2) {
        return ch1 - 'a' == ch2 - 'A' || ch1 - 'A' == ch2 - 'a';
    }
}
